from itertools import repeat
import re
import timeit


def decompression(comp_str):
    while re.search(r'(?P<number>[0-9]+)\[(?P<letters>[a-z]*)\]', comp_str):
        node = re.search(r'(?P<number>[0-9]+)\[(?P<letters>[a-z]*)\]', comp_str)
        comp_str = comp_str.replace(node.group(0), node.group('letters') * int(node.group('number')))
    return comp_str

def test():

    # multidigit
    test0 = '10[a]'
    answer = decompression(test0)
    assert answer == 'aaaaaaaaaa', \
        "answer was %s, not aaaaaaaaaa: " % answer

    # nested
    test1 = '2[3[a]b]'
    answer = decompression(test1)
    assert answer == 'aaabaaab', \
        "answer was %s, not aaabaaab: " % answer

    # recursive
    test2 = 'long2[chain]withlots3[3[of]chain]1[and2[some2[recursion]]]'
    answer = decompression(test2)
    assert answer == 'longchainchainwithlotsofofofchainofofofchainofofofchainandsomerecursionrecursionsomerecursionrecursion', \
        "answer was %s, not aaabaaab: " % answer

    # banger
    test3 = '2[2[2[2[2[2[a]b]c]d]e]f]g'
    answer = decompression(test3)
    assert answer == 'aabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefaabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefg', \
        "answer was %s, not aabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefaabaabcaabaabcdaabaabcaabaabcdeaabaabcaabaabcdaabaabcaabaabcdefg: " % answer

    # marks tests
    assert decompression('5[abc]4[ab]c') == 'abcabcabcabcabcababababc'
    assert decompression('2[3[a]b]') == 'aaabaaab'
    assert decompression('0[abc]') == ''
    assert decompression('5[0[a]]abc') == 'abc'
    assert decompression('5[1[a]]abc') == 'aaaaaabc'
    assert decompression('10[a]') == 'aaaaaaaaaa'
    assert decompression('2[5[a]ab]') == 'aaaaaabaaaaaab'

    # the real test 143 char -> 164999
    test_4 = '56[jjjjjsdfhhdhfdhfhdf100[eatdi0[43[jsdbf5[dujh4[ttttt]vdu]vlwsdhfbv]]cksjord10[a]n]hdfhdhfdfhd40[3[james]]fhdhfdhfdhfhdfhd]'
    answer = decompression(test_4)
    assert answer == ''


if __name__ is '__main__':
    t = timeit.Timer(test)
    print(t.timeit(2))
